import './App.css';
import React from 'react';



function TodoApp(props) {
  return (        
    <div className="App">
      <iframe
        width="560"
        height="315"
        src={url}
        frameborder="0"
        allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture"
        allowfullscreen
      ></iframe>
      <button onClick={() => setPlay(true)}>Play</button>
      <button onClick={() => setPlay(true)}>Play</button>
    </div>
      
    );


    
}


 
  export default TodoApp;
